import React from "react";
import Button from 'react-bootstrap/Button';

let AppTodo = () => {
    return (
        <div className="App">
            <div className="container">
                <input className="input"/>
                <Button className="btn" variant="outline-danger">Danger</Button>
                <div className="list">
                    <ul>
                        <div>
                            <li>sddsa</li>
                        </div>
                    </ul>
                </div>
            </div>
        </div>
    )
}

export default AppTodo
